        setItems(...items,data);
        setData("")
    }
  return (
    <>
    <div className="main-div">
        <div className="child-div">
            <h1>Enter your list here!</h1>
            <input type="text" name="todo" value={data} onChange={(e)=>setData(e.target.value )} />
            <button onClick={addItem}>Add</button>
            <div className="showItem">
                <h3>apple</h3>
